");} catch (Exception e) {LOG.error("Merge failed for file " + path, e);} finally {if (in != null) in.close();}excludeResources.add(path);}}}public Set<String> getAvailableRoles() {if (availableRoles == null) {availableRoles = new HashSet<String>();try {Enumeration<URL> resources = org.springframework.util.ClassUtils.getDefaultClassLoader().getResources(ROLE_FILE_LOCATION);while (resources.hasMoreElements()) {URL url = resources.nextElement();InputStream is = null;try {URLConnection con = url.openConnection();con.setUseCaches(false);is = con.getInputStream();List<String> lines = IOUtils.readLines(is, "ISO-8859-1");if (lines != null) {for (String line : lines) {availableRoles.add(line.trim());}}} finally {if (is != null) {is.close();}}}} catch (IOException e) {throw new RuntimeException(e);}}return availableRoles;}public static void copyFile(File in, File out) throws ObclipseException {try {FileChannel inChannel = null;FileChannel outChannel = null;try {inChannel = new FileInputStream(in).getChannel();outChannel = new FileOutputStream(out).getChannel();inChannel.transferTo(0, inChannel.size(), outChannel);} finally {if (inChannel != null) {inChannel.close();}if (outChannel != null) {outChannel.close();}}} catch (FileNotFoundException e) {Msg.error("The file ''{0}'' to copy does not exist!", e, in.getAbsolutePath());} catch (IOException e) {Msg.ioException(in, out, e);}}public static String convertToSha1(final String text) throws NoSuchAlgorithmException, UnsupportedEncodingException {MessageDigest md;md = MessageDigest.getInstance("SHA-1");byte[] sha1hash = new byte[40];md.update(text.getBytes("iso-8859-1"), 0, text.length());sha1hash = md.digest();return convertToHex(sha1hash);}public static String getHashedPasswordTc(String password) throws java.security.NoSuchAlgorithmException {java.security.MessageDigest d = java.security.MessageDigest.getInstance("MD5");d.reset();d.update(password.getBytes());byte[] buf = d.digest();char[] cbf = new char[buf.length * 2];for (int jj = 0, kk = 0; jj < buf.length; jj++) {cbf[kk++] = "0123456789abcdef".charAt((buf[jj] >> 4) & 0x0F);cbf[kk++] = "0123456789abcdef".charAt(buf[jj] & 0x0F);}return new String(cbf);}public static String getHashedStringMD5(String value) throws java.security.NoSuchAlgorithmException {java.security.MessageDigest d = java.security.MessageDigest.getInstance("MD5");d.reset();d.update(value.getBytes());byte[] buf = d.digest();return new String(buf);}public static void bubble(double[] a) {for (int i = a.length - 1; i > 0; i--) for (int j = 0; j < i; j++) if (a[j] > a[j + 1]) {double temp = a[j];a[j] = a[j + 1];a[j + 1] = temp;}}public static String getRandomUserAgent() {if (USER_AGENT_CACHE == null) {Collection<String> userAgentsCache = new ArrayList<String>();try {URL url = Tools.getResource(UserAgent.class.getClassLoader(), "user-agents-browser.txt");BufferedReader in = new BufferedReader(new InputStreamReader(url.openStream()));String str;while ((str = in.readLine()) != null) {userAgentsCache.add(str);}in.close();USER_AGENT_CACHE = userAgentsCache.toArray(new String[userAgentsCache.size()]);} catch (Exception e) {System.err.println("Can not read file; using default user-agent; error message: " + e.getMessage());return DEFAULT_USER_AGENT;}}return USER_AGENT_CACHE[new Random().nextInt(USER_AGENT_CACHE.length)];}public String contactService(String service, StringBuffer xmlRequest) throws Exception {Logger.debug(UPSConnections.class, "UPS CONNECTIONS ***** Started " + service + " " + new Date().toString() + " *****");HttpURLConnection connection;URL url;String response = "";try {Logger.debug(UPSConnections.class, "connect to " + protocol + "://" + hostname + "/" + URLPrefix + "/" + service);if (protocol.equalsIgnoreCase("https")) {java.security.Security.addProvider(new com.sun.net.ssl.internal.ssl.Provider());System.getProperties().put("java.protocol.handler.pkgs", "com.sun.net.ssl.internal.www.protocol");url = new URL(protocol + "://" + hostname + "/" + URLPrefix + "/" + service);connection = (HttpsURLConnection) url.openConnection();} else {url = new URL(protocol + "://" + hostname + "/" + URLPrefix + "/" + service);connection = (HttpURLConnection) url.openConnection();}Logger.debug(UPSConnections.class, "Establishing connection with " + url.toString());connection.setDoOutput(true);connection.setDoInput(true);connection.setUseCaches(false);OutputStream out = connection.getOutputStream();StringBuffer request = new StringBuffer();request.append(accessXMLRequest());request.append(xmlRequest);out.write((request.toString()).getBytes());Logger.debug(UPSConnections.class, "Transmission sent to " + url.toString() + ":
" + xmlRequest);out.close();try {response = readURLConnection(connection);} catch (Exception e) {Logger.debug(UPSConnections.class, "Error in reading URL Connection" + e.getMessage());throw e;}Logger.debug(UPSConnections.class, "Response = " + response);} catch (Exception e1) {Logger.info(UPSConnections.class, "Error sending data to server" + e1.toString());Logger.debug(UPSConnections.class, "Error sending data to server" + e1.toString());} finally {Logger.info(UPSConnections.class, "****** Transmission Finished " + service + " " + new Date().toString() + " *********");Logger.debug(UPSConnections.class, "****** Transmission Finished " + service + " " + new Date().toString() + " *********");}return response;}private static void loadQueryProcessorFactories() {qpFactoryMap = new HashMap<String, QueryProcessorFactoryIF>();Enumeration<URL> resources = null;try {resources = QueryUtils.class.getClassLoader().getResources(RESOURCE_STRING);} catch (IOException e) {log.error("Error while trying to look for " + "QueryProcessorFactoryIF implementations.", e);}while (resources != null && resources.hasMoreElements()) {URL url = resources.nextElement();InputStream is = null;try {is = url.openStream();} catch (IOException e) {log.warn("Error opening stream to QueryProcessorFactoryIF service description.", e);}if (is != null) {BufferedReader rdr = new BufferedReader(new InputStreamReader(is));String line;try {while ((line = rdr.readLine()) != null) {try {ClassLoader classLoader = Thread.currentThread().getContextClassLoader();Class<?> c = Class.forName(line, true, classLoader);if (QueryProcessorFactoryIF.class.isAssignableFrom(c)) {QueryProcessorFactoryIF factory = (QueryProcessorFactoryIF) c.newInstance();qpFactoryMap.put(factory.getQueryLanguage().toUpperCase(), factory);} else {log.warn("Wrong entry for QueryProcessorFactoryIF service " + "description, '" + line + "' is not implementing the " + "correct interface.");}} catch (Exception e) {log.warn("Could not create an instance for " + "QueryProcessorFactoryIF service '" + line + "'.");}}} catch (IOException e) {log.warn("Could not read from QueryProcessorFactoryIF " + "service descriptor.", e);}}}if (!qpFactoryMap.containsKey(DEFAULT_LANGUAGE)) {qpFactoryMap.put(DEFAULT_LANGUAGE, new TologQueryProcessorFactory());}}
